import matplotlib.pyplot as plt
def plot_image(ys_train, ys_test, xs, x_axis, title, name):
    import os

    path = os.path.dirname(os.path.dirname(os.path.abspath(__file__))) + '/laundry_sorting/svg_result/'
    print(path)
    plt.figure()
    plt.axis([0, x_axis, 0, 1])
    plt.plot(xs, ys_train)
    plt.plot(xs, ys_test)
    plt.legend(('Train', 'Test'))
    plt.xticks(range(0, x_axis, int(x_axis / 10)))
    plt.yticks(np.arange(0, 1.2, 0.1))
    plt.xlabel('Iteration Time')
    plt.ylabel('Accuracy')
    plt.title(title)
    plt.savefig(path + name + '.svg')
    plt.close()

